import React, { Component } from 'react';
import './App.scss';
import Menu from './containers/Menu/Menu.js'
import Main from './containers/Main/Main.js'


export default class App extends Component {
  render() {
	return (
		<div className="App">
			<div className='row'>
				<div className='col-2'>
					<Menu />
				</div>
				<div className='col-10'>
					<Main />
				</div>
			</div>
		</div>
	  );

  }
}
